<!doctype html>
<html lang="fr">
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1">
<title>Entremecs-gay — liens d'écoute</title>
<meta name="description" content="Podcast immersif érotique gay. Histoires sensuelles entre mecs.">
<style>
  :root{
    --bg:#000;
    --text:#fff;
    --muted:#b9b9c2;
    --pill:#0f0f16;
    --pill-hover:#171727;
  }
  *{box-sizing:border-box}
  html,body{height:100%}
  body{
    margin:0; background:var(--bg); color:var(--text);
    font-family:system-ui,-apple-system,Segoe UI,Roboto,Arial,Helvetica,sans-serif;
    display:flex; align-items:flex-start; justify-content:center;
    min-height:100svh; padding:18px 16px 32px; text-align:center;
  }
  .wrap{ width:min(560px,100%); }
  /* Logo + neon ring container (from v6) */
  .logo-wrap{
    position:relative; width:200px; height:200px; margin:10px auto 10px;
  }
  .logo-wrap img{
    width:100%; height:100%; display:block; border-radius:50%; object-fit:contain;
    box-shadow: inset 0 0 0 1px #ffffff0f;
  }
  .logo-wrap::before{
    content:""; position:absolute; inset:-16px; border-radius:50%;
    background:
      conic-gradient(
        from 0deg,
        rgba(255,0,204,0.98) 0%,
        rgba(25,195,255,0.98) 28%,
        rgba(138,92,255,0.9) 45%,
        rgba(25,195,255,0.98) 66%,
        rgba(255,0,204,0.98) 100%
      );
    -webkit-mask: radial-gradient(closest-side, transparent 86%, #000 87%, #000 94%, transparent 95%);
            mask: radial-gradient(closest-side, transparent 86%, #000 87%, #000 94%, transparent 95%);
    filter: blur(14px);
    animation: neonBroken 6.8s infinite;
  }
  .logo-wrap::after{
    content:""; position:absolute; inset:-18px; border-radius:50%;
    background:
      repeating-conic-gradient(from 12deg,
        rgba(255,0,204,0.9) 0 6deg,
        rgba(255,0,204,0.0) 6deg 8deg,
        rgba(25,195,255,0.9) 8deg 14deg,
        rgba(25,195,255,0.0) 14deg 16deg
      );
    -webkit-mask: radial-gradient(closest-side, transparent 86%, #000 87%, #000 93%, transparent 94%);
            mask: radial-gradient(closest-side, transparent 86%, #000 87%, #000 93%, transparent 94%);
    filter: blur(12px);
    mix-blend-mode: screen;
    animation: sputter 3.6s infinite steps(60);
    opacity:.8;
    pointer-events:none;
  }
  @keyframes neonBroken{
    0%   { opacity:1;   transform:rotate(0.0deg) scale(1);   }
    6%   { opacity:.35; transform:rotate(0.6deg) scale(1.01);}
    8%   { opacity:1;   transform:rotate(0.0deg) scale(1.00);}
    14%  { opacity:.15; transform:rotate(-0.4deg) scale(1.01);}
    16%  { opacity:1; }
    29%  { opacity:.5;  transform:rotate(0.8deg) scale(1.01);}
    31%  { opacity:1;   transform:rotate(0deg); }
    47%  { opacity:.25; transform:rotate(-0.5deg) scale(0.995);}
    50%  { opacity:1; }
    66%  { opacity:.4;  transform:rotate(0.4deg) scale(1.01);}
    68%  { opacity:1; }
    82%  { opacity:.2;  transform:rotate(-0.3deg) scale(1.005);}
    86%  { opacity:1; }
    93%  { opacity:.55; transform:rotate(0.5deg) scale(1.01);}
    100% { opacity:1;   transform:rotate(0deg)  scale(1); }
  }
  @keyframes sputter{
    0%{ opacity:.85; }
    12%{ opacity:.25; }
    14%{ opacity:.9;  }
    35%{ opacity:.4;  }
    38%{ opacity:.95; }
    60%{ opacity:.3;  }
    62%{ opacity:.9;  }
    80%{ opacity:.5;  }
    84%{ opacity:1;   }
    100%{ opacity:.8; }
  }
  /* TEXT BLOCK pushed down (new in v7) */
  .text-block{
    margin-top: clamp(22px, 6.5vw, 46px);
  }
  h1{ font-size:clamp(22px,4.8vw,28px); margin:6px 0 6px; letter-spacing:-0.01em; }
  p.desc{ color:var(--muted); margin:0 0 14px; line-height:1.4; }
  .links{ display:grid; gap:12px; margin-top:0; }
  .link{
    display:flex; align-items:center; justify-content:center; gap:10px;
    padding:13px 18px; border-radius:999px; text-decoration:none; color:var(--text);
    background:var(--pill); box-shadow: inset 0 0 0 1px #ffffff12;
    transition: box-shadow .25s ease, background .25s ease, transform .05s ease;
    -webkit-tap-highlight-color: transparent;
  }
  .link:hover{
    background:var(--pill-hover);
    box-shadow: 0 0 0 1px #ffffff24,
                0 0 30px 0 rgba(25,195,255,.45),
                0 0 44px 0 rgba(255,0,204,.45);
  }
  .link:active{ transform:scale(.985); }
  .icon{ width:20px; height:20px; display:block; flex:0 0 auto; fill:#fff; }
  footer{ margin-top:18px; color:#8e8ea3; font-size:12px; }
</style>
</head>
